Its an animated movie about a dog. GIVEN, its a 'kids' movie. Unlike many animated movies, the dialog isn't full of innuendos or 'hidden' humor that only adults would 'get'. Its easily understood by kids, the animation is top-rate (as would be expected) and the characters are engaging and easy to enjoy. 

